import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  const [activeIdx, setActiveIdx] = useState(0);

  const courses = [
    { id: "linux", title: "Linux Admin", img: "https://images.unsplash.com/photo-1629654297299-c8506221ca97?q=80&w=1000&auto=format&fit=crop" },
    { id: "cyber", title: "Cyber Security", img: "https://images.unsplash.com/photo-1550751827-4bd374c3f58b?q=80&w=1000&auto=format&fit=crop" },
    { id: "net", title: "Networking", img: "https://images.unsplash.com/photo-1544197150-b99a580bb7a8?q=80&w=1000&auto=format&fit=crop" },
    { id: "py_basic", title: "Python Basic", img: "https://images.unsplash.com/photo-1526374965328-7f61d4dc18c5?q=80&w=1000&auto=format&fit=crop" },
    { id: "py_adv", title: "Python Advanced", img: "https://images.unsplash.com/photo-1515879218367-8466d910aaa4?q=80&w=1000&auto=format&fit=crop" },
    { id: "hacking", title: "World Hacking", img: "https://images.unsplash.com/photo-1563986768609-322da13575f3?q=80&w=1000&auto=format&fit=crop" }
  ];

  return (
    <div style={styles.body}>
      {/* Navbar Section */}
      <nav style={styles.nav}>
        <h2 style={{ color: '#00ff41', margin: 0 }}>CYBER_SHIELD</h2>
        <div>
          <Link to="/login" style={styles.navLink}>STUDENT LOGIN</Link>
          <Link to="/register" style={styles.regBtn}>JOIN NOW</Link>
        </div>
      </nav>

      {/* Hero Section */}
      <div style={styles.heroText}>
        <h1 style={{fontSize: '3.5rem', marginBottom: '10px'}}>SELECT YOUR MISSION</h1>
        <p style={{color: '#8892b0'}}>Explore our expert-led cybersecurity tracks</p>
      </div>

      {/* Carousel Slider Section */}
      <div style={styles.container}>
        <div style={styles.slide}>
          {courses.map((course, index) => (
            <div 
              key={index}
              style={{
                ...styles.item,
                backgroundImage: `url(${course.img})`,
                transform: index === 0 ? 'translate(0, 0)' : 
                           index === 1 ? 'translate(0, 0)' :
                           `translate(${index * 200}px, 0)`,
                opacity: index >= 6 ? 0 : 1,
                display: index === 0 ? 'block' : 'inline-block',
                width: index < 2 ? '100%' : '190px',
                height: index < 2 ? '100%' : '280px',
                borderRadius: index < 2 ? '0' : '20px',
                position: index < 2 ? 'absolute' : 'absolute',
                top: index < 2 ? '0' : '70%',
                boxShadow: index < 2 ? 'none' : '0 30px 50px #000'
              }}
            >
              <div style={{
                ...styles.content,
                display: index < 2 ? 'block' : 'none'
              }}>
                <div style={styles.name}>{course.title}</div>
                <div style={styles.des}>Master the tools and techniques used by professionals in the field. Join this class to elevate your skills.</div>
                <Link to="/register"><button style={styles.seeMoreBtn}>See More</button></Link>
              </div>
            </div>
          ))}
        </div>

        {/* Navigation Buttons */}
        <div style={styles.buttonContainer}>
          <button style={styles.navBtn} onClick={() => {
             // Logic to move first item to last (simple state array rotation can be added)
             alert("Next mission loading...");
          }}>❮</button>
          <button style={styles.navBtn} onClick={() => {
             alert("Previous mission loading...");
          }}>❯</button>
        </div>
      </div>
    </div>
  );
};

const styles = {
  body: {
    backgroundColor: '#0a192f',
    height: '100vh',
    overflow: 'hidden',
    fontFamily: 'monospace',
    color: '#ccd6f6'
  },
  nav: {
    display: 'flex', justifyContent: 'space-between', alignItems: 'center',
    padding: '20px 50px', background: 'rgba(10, 25, 47, 0.8)',
    position: 'fixed', width: '100%', zIndex: 1000
  },
  navLink: { color: '#ccd6f6', textDecoration: 'none', marginRight: '20px', fontSize: '14px' },
  regBtn: { padding: '8px 20px', border: '1px solid #00ff41', color: '#00ff41', textDecoration: 'none', borderRadius: '5px' },
  heroText: {
    textAlign: 'center', paddingTop: '120px', position: 'relative', zIndex: 10
  },
  container: {
    position: 'absolute', top: '55%', left: '50%',
    transform: 'translate(-50%, -50%)',
    width: '1000px', height: '550px',
    background: '#0a192f',
    boxShadow: '0 30px 50px #000'
  },
  item: {
    backgroundPosition: 'center',
    backgroundSize: 'cover',
    transition: '0.5s',
  },
  content: {
    position: 'absolute', top: '50%', left: '100px',
    transform: 'translate(0, -50%)',
    width: '400px', textAlign: 'left',
    color: '#eee',
    textShadow: '0 5px 10px rgba(0,0,0,0.8)'
  },
  name: { fontSize: '40px', fontWeight: 'bold', color: '#00ff41' },
  des: { margin: '20px 0', fontSize: '16px' },
  seeMoreBtn: {
    padding: '10px 20px', border: 'none', cursor: 'pointer',
    background: '#00ff41', color: '#0a192f', fontWeight: 'bold'
  },
  buttonContainer: {
    position: 'absolute', bottom: '20px', left: '50%',
    width: 'max-content', display: 'flex', gap: '20px'
  },
  navBtn: {
    width: '50px', height: '50px', borderRadius: '50%',
    border: '1px solid #00ff41', background: 'transparent',
    color: '#00ff41', cursor: 'pointer', transition: '0.3s',
    fontSize: '20px'
  }
};

export default Home;
